  //mostrar nombre
  console.log(props.nombre)
  //mostrar edad
  console.log(props.edad)
  //mostrar nacionalidad
  console.log(props.nacionalidad)

  return (
    <div>
        <h1>{props.nombre}</h1>
        <p>Edad: {props.edad}</p>
        <p>Nacionalidad: {props.nacionalidad}</p>
        <image>{props.imagen}</image>
        <hr></hr>
    </div>
    )
}
